import React, { useState } from "react";

function Aaa() {
  return (
    <div className="app">
      <form className="todo-list">
        <ul>
          <div className="todo">
            <div className="checkbox" />
            <input type="text" value="Todo one" />
          </div>
        </ul>
      </form>
    </div>
  );
}

export default Aaa;
